input = ""
function reduce(str, list)
    local ostr = str
    local r = true
    while r do
        local i = 1
        r = false
        while (i < #ostr) do
            local s1 = ostr:sub(i, i)
            local s2 = ostr:sub(i + 1, i + 1)
            if list then
                list[s1] = true
                list[s2] = true
            end
            if s1 ~= s2 and s1:lower() == s2:lower() then
                ostr = ostr:sub(1, i - 1) .. ostr:sub(i + 2)
                r = true
            else
                i = i + 1
            end
        end
    end
    return ostr
end
list = {}
output = reduce(input, list)
--part 1
print("answer 1:" .. #output)
for i in pairs(list) do
    if i == i:lower() then
        input2 = input:gsub("(%a)", function (s) if s:lower() == i then return "" else return s end end)
        output = reduce(input2)
        l = #output
        if not minimal or l < minimal then
            minimal = l
        end
    end
end
print("answer 2:" .. (minimal and minimal or ""))
